  [],\n\t\"revision_timestamp\": \"2015-05-07T05:55:16.171684\",\n\t\"name\": \"compact-monitor-for-airborne-carbon-dioxide-measurements-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Eltron Research &amp; Development proposes
  the development of a lightweight, battery-powered instrument for accurately and
  rapidly monitoring the local concentration of carbon dioxide (CO2) in the atmosphere.
  In our Phase I program, an advanced CO2 analyzer will be developed with a novel
  optical sensor employing a sample concentrator in conjunction with single-beam,
  dual-wavelength infrared measurements. The proposed monitor will utilize a thin,
  IR transparent film to selectively and reversibly concentrate CO2 for enhanced detection.
  The film's high partitioning coefficient will enable a short pathlength and low
  power requirements while achieving the accuracy, response time, and detection limits
  necessary for airborne atmospheric monitoring.rntPhase I of this project will accomplish
  evaluation of a breadboard system in the laboratory; we anticipate a TRL of 4 by
  the end of Phase I. By the end of the Phase II program, a prototype instrument will
  be built with 10.1 ppm resolution in a background of ca. 385 ppm, &lt;10 s response
  time, 800 mW power requirements, and 250 g total weight. The CO2 analyzer, which
  will be of reduced size and significantly more cost-effeective than the current
  state-of-the-art, will be suitable for use on Unmanned Aerial Vehicle and balloon
  platforms. rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
